const e = createEngine(gameCanvas, 300, 300);

e.addText("a frame is missing!", e.width/2,            52, { size: 20 });
e.addText("can you fix it?",     e.width/2, e.height - 30, { size: 20 });

let frame = 0;
setInterval(() => frame++, 175);

e.add({
  x: e.width / 2,
  y: e.height / 2,
  origin: [0.5, 0.5],
  scale: 7,
  update(knight) {
         if (frame == 0) knight.sprite = knight_run_0;
    else if (frame == 1) knight.sprite = knight_run_1;
    else if (frame == 2) knight.sprite = knight_run_2;
    else frame = 0;
  }
})

e.start();
